def get_pos(event):
    xwin = top.winfo_x()
    ywin = top.winfo_y()
    startx = event.x_root
    starty = event.y_root

    ywin = ywin - starty
    xwin = xwin - startx

    def move_window(event):
        top.geometry("446x795" + '+{0}+{1}'.format(event.x_root + xwin, event.y_root + ywin))
    startx = event.x_root
    starty = event.y_root

    top.bind('<B1-Motion>', move_window)
top.bind('<Button-1>', get_pos)



