def backward(Event):
    stop=0
    top.updown=1
    global introlist, introcount
    introcount -= 1
    if introcount >= 4 :
        introcount=4
        stop=1

    if introcount <= 0:
        introcount=0
        stop=1
    
    if introcount==0:
        can.tag_lower(backarrowp)
        can.tag_raise(forarrowp)
    else:
        can.tag_raise(backarrowp)
        can.tag_raise(forarrowp)

    if stop !=1:
        chater()
    l2 = l
    try:
        l2.remove(introcount)
        can.tag_raise(introlist[introcount])
        for i in l2:
            can.tag_lower(introlist[i])
    except:
        pass

    l.append(introcount)
    l.sort()
    


def forward(Event):
    stop=0
    global introlist, introcount
    introcount += 1
    if introcount <= 0:
        introcount=0
        stop=1

    if introcount >= 4:
        introcount = 4
        stop=1
    
    if introcount==4:
        can.tag_lower(forarrowp)
        can.tag_raise(backarrowp)
    else:
        can.tag_raise(forarrowp)
        can.tag_raise(backarrowp)

    if stop !=1:
        chater()
    l2 = l
    try:
        l2.remove(introcount)
        can.tag_raise(introlist[introcount])
        for i in l2:
            can.tag_lower(introlist[i])
    except:
        pass

    l.append(introcount)
    l.sort()


