def load_words():
    global valid_words
    with open(top.basepath+r"clips\english2.txt") as word_file:
        valid_words = set(word_file.read().split())

    return valid_words


def returner(sc):
    f = open(top.basepath+r"clips\english2.txt", "r")
    words = f.readlines()
    f.close()

    worddict = {'a': [], 'b': [], 'c': [], 'd': [], 'e': [], 'f': [], 'g': [], 'h': [], 'i': [], 'j': [], 'k': [], 'l': [], 'm': [
    ], 'n': [], 'o': [], 'p': [], 'q': [], 'r': [], 's': [], 't': [], 'u': [], 'v': [], 'w': [], 'x': [], 'y': [], 'z': []}

    for i in words:
        worddict[i[0]].append(i.rstrip("\n"))

    retword = random.choice(worddict[sc])

    while len(retword)>9:
        retword = random.choice(worddict[sc])

    return retword


def countdown(count):
    global c
    label['text'] = (count)
    if "int" in str(type(count)):
        if count > 0:
            c=top.after(1000, countdown, count-1)
            if count<10:
                label['text'] = ("0"+str(count))
            if count < 6:
                effect = pygame.mixer.Sound(
                    top.basepath+r"clips\logophile_NTimer.wav")
                effect.play()
            else:
                pass
        if count == 0:
            label['text'] = ("00")
            you_lost()
            return
    else:
        label['text'] = ("00")
