def oupputter(Event):

    if top.startgame ==1:
        top.startgame = 0

    if top.exist ==0:
        top.exist = 1
    
    if top.rules==0:
        top.rules = 1
    
    if top.used==0:
        top.used = 1

    
    pygame.mixer.music.load(
        top.basepath+r"clips\logophile_AddWord_Aloud.mp3")
    pygame.mixer.music.play()

    global wordlist, a,b, checker, c
    english_words = load_words()
    inword = (txt.get()).lower()
    txt.delete(0, 'end')
    char = inword[len(inword)-1]
    returnword = returner(char)
    chec = inword[0]

    if inword in english_words:
        if inword not in wordlist:
            if b==1:
                top.yourscore += len(inword)
                iw = inword+ "("+"+"+str(len(inword))+")"
                outputboxy.config(state="normal")
                outputboxy.insert('end',iw , 'tag-left')
                outputboxy.see("end")
                outputboxy.config(state="disabled")
                b+=1

            if a == 1:
                ret = "("+"+"+str(len(returnword))+")"+returnword
                outputboxm.config(state="normal")
                outputboxm.insert('end', ret, 'tag-right')
                outputboxm.see("end")
                outputboxm.config(state="disabled")

                top.myscore +=len(returnword)
                countdown(20)
                a += 1
                checker = returnword[len(returnword)-1]
                wordlist.append(returnword)
                wordlist.append(inword)
                
            elif chec == checker:
                top.yourscore += len(inword)

                iw = "\n"+inword+ "("+"+"+str(len(inword))+")"
                outputboxy.config(state="normal")
                outputboxy.insert('end',iw , 'tag-left')
                outputboxy.see("end")
                outputboxy.config(state="disabled")

                ret = "\n" + "("+"+"+str(len(returnword))+")"+returnword
                outputboxm.config(state="normal")
                outputboxm.insert('end', ret, 'tag-right')
                outputboxm.see("end")
                outputboxm.config(state="disabled")

                top.myscore += len(returnword)
                treset(c)
                countdown(20)
                checker = returnword[len(returnword)-1]
                wordlist.append(returnword)
                wordlist.append(inword)
            else:
                stick_to_rules()
                pygame.mixer.music.load(
                    top.basepath+r"clips\logophile_incorrect.mp3")
                pygame.mixer.music.play()

            if top.yourscore > 9:
                yscore.config(text=str(top.yourscore))
            else:
                yscore.config(text="0"+str(top.yourscore))

            if top.yourscore >= top.maxscore:
                you_won()
                return

            if top.myscore > 9:
                mscore.config(text=str(top.myscore))
            else:
                mscore.config(text="0"+str(top.myscore))

            if top.myscore>=top.maxscore:
                you_lost()
                return
            
            if top.myscore>99:
                mscore.config(font=("pixel operator", 20))
                mscore.place(x=387, y=112)
            
            if top.yourscore>99:
                yscore.config(font=("pixel operator", 20))
                yscore.place(x=17, y=112)

        else:
            already_used()
            pygame.mixer.music.load(
                top.basepath+r"clips\logophile_incorrect.mp3")
            pygame.mixer.music.play()
    else:
        doesnt_exists()
        pygame.mixer.music.load(
            top.basepath+r"clips\logophile_incorrect.mp3")
        pygame.mixer.music.play()


