def mcountdown(count):
    global mc
    mlabel['text'] = (count)
    if "int" in str(type(count)):
        if count > 0:
            mc = top.after(1000, mcountdown, count-1)
            if count < 10:
                mlabel['text'] = ("0"+str(count))
            if count < 6:
                effect = pygame.mixer.Sound(
                    top.basepath+r"clips\logophile_NTimer.wav")
                effect.play()
            else:
                pass
        if count == 0:
            mlabel['text'] = ("00")
            you_lost()
            return
    else:
        mlabel['text'] = ("00")


