def mulputter(Event):
    if top.startgame == 1:
        top.startgame = 0

    if top.exist == 0:
        top.exist = 1

    if top.rules == 0:
        top.rules = 1

    if top.used == 0:
        top.used = 1

    def addmusic():
        pygame.mixer.music.load(
            top.basepath+r"clips\logophile_AddWord_Aloud.mp3")
        pygame.mixer.music.play()

    global wordlist, a, b, checker, mc, a2,b2 ,you,me
    english_words = load_words()

    if me == 1:
        returnword = top.mycurrentword = (mtxt.get()).lower()
        mtxt.delete(0, 'end')
        chec = top.yourcurrentword[len(top.yourcurrentword)-1]
        if returnword != "": 
            if returnword in english_words:
                if returnword not in wordlist:
                    if returnword[0] == chec:
                        if a==1:
                            me = 0
                            you = 1
                            addmusic()
                            ret = "("+"+"+str(len(returnword))+")"+returnword
                            moutputboxm.config(state="normal")
                            moutputboxm.insert('end', ret, 'tag-right')
                            moutputboxm.see("end")
                            moutputboxm.config(state="disabled")

                            top.myscore += len(returnword)
                            treset(mc)
                            mcountdown(20)
                            wordlist.append(returnword)
                            a+=1
        
                        elif returnword in english_words:
                            me = 0
                            you = 1
                            addmusic()
                            ret = "\n" + "("+"+"+str(len(returnword))+")"+returnword
                            moutputboxm.config(state="normal")
                            moutputboxm.insert('end', ret, 'tag-right')
                            moutputboxm.see("end")
                            moutputboxm.config(state="disabled")
        
                            top.myscore +=len(returnword)
                            treset(mc)
                            mcountdown(20)
                            wordlist.append(returnword)
                    else:
                        stick_to_rules()
                        pygame.mixer.music.load(
                            top.basepath+r"clips\logophile_incorrect.mp3")
                        pygame.mixer.music.play()
                else:
                    already_used()
                    pygame.mixer.music.load(
                        top.basepath+r"clips\logophile_incorrect.mp3")
                    pygame.mixer.music.play()
            else:
                doesnt_exists()
                pygame.mixer.music.load(
                    top.basepath+r"clips\logophile_incorrect.mp3")
                pygame.mixer.music.play()
        else:
            pass



    if you == 1:
        inword = top.yourcurrentword = (mtxt.get()).lower()
        mtxt.delete(0, 'end')
        if inword !="":
            if inword not in wordlist:
                if inword in english_words:
                    if b==1:
                        me = 1
                        you = 0
                        addmusic()
                        iw = inword + "("+"+"+str(len(inword))+")"
                        moutputboxy.config(state="normal")
                        moutputboxy.insert('end', iw, 'tag-left')
                        moutputboxy.see("end")
                        moutputboxy.config(state="disabled")
                        top.yourscore += len(inword)
                        wordlist.append(inword)
                        mcountdown(20)
                        b+=1
                    
                    elif top.mycurrentword[len(top.mycurrentword)-1] == inword[0]:
                        me = 1
                        you = 0
                        addmusic()
                        iw = "\n"+inword + "("+"+"+str(len(inword))+")"
                        moutputboxy.config(state="normal")
                        moutputboxy.insert('end', iw, 'tag-left')
                        moutputboxy.see("end")
                        moutputboxy.config(state="disabled")
                        treset(mc)
                        mcountdown(20)
                        top.yourscore += len(inword)
                        wordlist.append(inword)
                    else:
                        stick_to_rules()
                        pygame.mixer.music.load(
                            top.basepath+r"clips\logophile_incorrect.mp3")
                        pygame.mixer.music.play()
                else:
                    doesnt_exists()
                    pygame.mixer.music.load(
                        top.basepath+r"clips\logophile_incorrect.mp3")
                    pygame.mixer.music.play()
            else:
                already_used()
                pygame.mixer.music.load(
                    top.basepath+r"clips\logophile_incorrect.mp3")
                pygame.mixer.music.play()
        else:
            pass


    if top.yourscore > 9:
        m_yscore.config(text=str(top.yourscore))
    else:
        m_yscore.config(text="0"+str(top.yourscore))

    if top.yourscore >= top.maxscore:
        you_won()
        return

    if top.myscore > 9:
        mmscore.config(text=str(top.myscore))
    else:
        mmscore.config(text="0"+str(top.myscore))

    if top.myscore >= top.maxscore:
        you_lost()
        return


    if top.myscore > 99: 
        mscore.config(font=("pixel operator", 20))
        mscore.place(x=387, y=112)

    if top.yourscore > 99:
        yscore.config(font=("pixel operator", 20))
        yscore.place(x=17, y=112)



